    public class ApartmentCategories
    {
        private readonly ElevationsDbContext _context;

        public ApartmentCategories(ElevationsDbContext context)
        {
            _context = context;
        }

        public List<Apartments> Apartments
        {
            get
            {
                return GetInitialApartments();
            }
        }

        public void Create()
        {
            CreateApartmentCategories();
        }

        private void AddApartmentIfNotExists(Apartments apartments)
        {
            if (_context.Apartments.IgnoreQueryFilters().Any(l => l.Name == apartments.Name))
            {
                return;
            }

            _context.Apartments.Add(apartments);
            _context.SaveChanges();
        }

        private void CreateApartmentCategories()
        {
            foreach (var apartment in Apartments)
            {
                AddApartmentIfNotExists(apartment);
            }
        }

